import React from 'react';

function Add(a,b){
    return (
        a+b
    )
};

function Sub(a,b){
    return (
        a-b
    )
};

function Div(a,b){
    let div = a/b;
    div = div.toFixed(3);
    return div
};

function Mult(a,b){
    return (
        a*b
    )
};



export default Add;
